食器洗い乾燥機ＯＫのお箸とケースのセットです。<br>
<br>
ケースは、指で引き出すスライド式で、<br>
衝撃に強くこわれにくい丈夫な構造です。<br>
<br>
フタの本体からの抜け落ちを防ぐ、<br>
外れにくい構造のストッパー付き。<br>
<br>
力を入れて引っ張ると外れるので、<br>
洗いやすく分解可能になっています。<br>
<br>
おハシには名前を入れられるスペース付き。<br>
<br>
ケース用の名前シールも付いてます。<br>
